comment:
베댓에 갑자기 연애혁명 머리채는 왜 잡아;
왕자림이 공주영한테 심하게 군 거, 왕자림이 공주영 싫다고 하는데도 공주영이 계속 들러붙은거 전부 댓글에서 뭐라고 한 마디씩 했음.
괜히 다른 웹툰 끌고와서 비교질 하지 마세요.

와ㅋㄲㅋㄲㅋ해수부모가 어떻게 그러나; 
해수가 행복해하는데 좋아해줘야지
그 반대냐? 인성이 더럽다 더러워

이게 소설에서는 정황이 다 이해가게 풀어져있는데 웹툰으로 옮기다보니 생략된게 많아서 오해하게되는 부분이 꽤많네요.
선호는 계약결혼을 알고있기에 놀란거고, 쌤 침실건도 
계속 꾸는 악몽으로 불면증인데 서재 쇼파에서 자서 수면부족으로 침대쓰고자하는것도 생략됬고, 쌤이 강압적이기만한게 아닌데 그렇게 표현된부분이 크고,  그렇게보이게 되는 이유도 조금 짐작되게 같이 진행되는데 여기선 좀 연출이 잘린게많아요;; 그래서 쌤이 좀 욕먹게되는;;

serea058님아;;
선호가 아무리 해수를 좋아해도 해수는 이미 임자 있는 몸이예요!! 
그리고 남편이랑 통화중인데 잠깐만 하고 폰 빼서가는건 너무하잖아요. 님이 선호한테 감정있는건 아니구요??

쌤 진짜 별로다 좋아하는건 알겠는데 그렇다고 여주 의견은 묻지도 않고 방 같이 쓰자고함;
선호가 저 말 듣고 충격먹고 뭐라 할만 한거아닌가.ㅡ? 
결혼한건 맞지만 그게 원해서 한 결혼도 아니였고 게다가 저 쌤은 그전까진 무시까고 막대했었는걸? 선호는 그것만 봤고 그리고 후에 좋아하고도 그닥...챙겨주는건 좋은데 지 멋대로잖아 여주도 사람임

)))중요한건 해수(((
독사든 선호든  둘다 꼴볼견인데
해수를 물건취급하고있음,,,,애 감정은 안중요하냐 일방적으로  사랑을 강요하는거랑 다를게 뭐임

언제는 사업이 목적이라서 결혼한거잖아 남주야;;
근데 갑자기 태세전환 쩐다  해수는 이혼날만
기다리는거 같고 ;; 남주 아직도 정이 안감

하 이게 소설에서 웹툰으로 오면서 뭔가 이야기가 많이 생략되다보니 오해하는 부분들이 많네요. 일단 선호?랑은 사랑하는 사이 아니에요 선호 혼자 짝사랑하는거고 혜수는 한번도 남자로 느낀적없는 오빠같은 가족같은 고마운 사람이에요. 그리고 독사가 혜수와 결혼한것돚다 혜수를위한건데 아? 그 내용이 아직 안나와서 이러는구나;;
암튼 결혼하고 5년간 미국에서 지내며 혜수에게 든든한 배경 버팀목은 되주며 자유를 주려고한거에요. 그러나 의도치않게 돌아와버렸지만.
아직 전개도 다 안됬고 생략된부분도 많아서 이런 반응들이네요
